return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2025-05-03 07:29:42+0000','plural-forms'=>'nplurals=3; plural=(n % 10 == 1 && n % 100 != 11) ? 0 : ((n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 12 || n % 100 > 14)) ? 1 : 2);','project-id-version'=>'Plugins - Custom Post Type UI - Stable (latest release)','language'=>'ru','messages'=>['(e.g. Movie trashed.)'=>'(напр., Фильм отправлен в корзину)','Item Trashed'=>'Запись отправлена в корзину','Back to top'=>'Наверх','Secondary menu'=>'Дополнительное меню','%1$s version %2$s by %3$s'=>'%1$s версия %2$s от %3$s','Theme support for post formats'=>'Поддержка форматов постов в теме','Theme support for featured images'=>'Поддержка тем для избранных изображений','Featured images and Post Formats need theme support added, to be used.'=>'Избранные изображения и форматы записей нуждаются в добавленной поддержке темы, чтобы их использовать.','Provide a callback function that sets up the meta boxes for the edit form. Do `remove_meta_box()` and `add_meta_box()` calls in the callback. Default null.'=>'Предоставьте функцию обратного вызова, которая настраивает мета-поля для формы редактирования. Выполняйте вызовы \'remove_meta_box()\' и \'add_meta_box()\' в обратном вызове. Значение по умолчанию равно null.','(default: wp/v2) To change the namespace URL of REST API route.'=>'(по умолчанию: wp/v2) Изменение URL-адреса пространства имен маршрута REST API.','REST API namespace'=>'Пространство имен REST API','Whether terms in this taxonomy should be sorted in the order they are provided to wp_set_object_terms()'=>'Должны ли термины в этой таксономии сортироваться в том порядке, в котором они предоставляются wp_set_object_terms()','Sort'=>'Сортировать','(default: false) Whether the taxonomy can have parent-child relationships. "True" gives checkboxes, "False" gives text input.'=>'(по умолчанию: false) Может ли таксономия иметь отношения родитель-потомок. "True" ставит флажки, "False" дает текстовый ввод.','The description is not prominent by default; however, some themes may show it.'=>'Описания не видно по умолчанию, однако некоторые темы могут его показывать.','Description for the Description field on Edit Tags screen.'=>'Описание для поля Описание на экране Редактирование тегов.','Term Description Field Description'=>'Описание термина Описание поля Описание','(e.g. "The description is not prominent by default; however, some themes may show it."'=>'(например, "Описание не является заметным по умолчанию; однако некоторые темы могут показать это».','The "slug" is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'"Slug" это краткая и понятная URL-версия имени. Как правило, в нижнем регистре и содержит только буквы, цифры и дефисы.','Description for the Slug field on Edit Tags screen. '=>'Описание поля Slug на экране Редактирования тегов. ','Term Slug Field Description'=>'Описание поля слизняка термина','(e.g. "The « slug » is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens."'=>'(Например, «Слаг» — это URL-совместимая версия имени. Обычно все они написаны строчными буквами и содержат только буквы, цифры и дефисы».','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'Назначить родительский элемент для создания иерархии. "Дерево", например, может быть родителем для "ели" и "березы".','Description for the Parent field on Edit Tags screen.'=>'Описание поля "Родитель" на экране "Изменение тегов".','Term Parent Field Description'=>'Описание родительского поля термина','(e.g. "Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band."'=>'(Например, "Назначьте родительский термин для создания иерархии. Например, термин Jazz будет родителем терминов Bebop и Big Band"','The name is how it appears on your site.'=>'Имя, как оно появляется на вашем сайте.','Description for the Name field on Edit Tags screen.'=>'Описание поля «Имя» на экране «Редактирование тегов».','Term Name Field Description'=>'Название термина Описание поля','(e.g. "The name is how it appears on your site."'=>'(Например, «Имя — это то, как оно отображается на вашем сайте».','If you have set "exclude from search" to True for the pot type, this would be why. If you need the post types in the archives, but still want to exclude them from search, it is recommended to use the "pre_get_posts" hook to unset the post type from considered types.'=>'Если вы установили для параметра "исключить из поиска" значение True для типа банка, вот почему. Если вам нужны типы записей в архивах, но вы все же хотите исключить их из поиска, рекомендуется использовать хук «pre_get_posts», чтобы отменить тип записи от рассматриваемых типов.','Why are my post types not showing in taxonomy term archives?'=>'Почему мои типы постов не отображаются в архивах терминов таксономии?','(default: false) Can this post_type be exported.'=>'(по умолчанию: false) Можно ли экспортировать эту post_type.','Can Export'=>'Может экспортировать','(default: false) Whether or not to exclude posts with this post type from front end search results. This also excludes from taxonomy term archives.'=>'(по умолчанию: false) Исключать или нет сообщения с этим типом сообщения из результатов поиска на передней панели. Это также исключает из архивов термины таксономии.','Add %s'=>'Добавить %s','(e.g. Add Movie)'=>'(напр., Добавить фильм)','Placeholder text in the "title" input when creating a post. Not exportable.'=>'Замещающий текст во входных данных "title" при создании записи. Не экспортируется.','Add Title'=>'Добавить заголовок','(default: inherited from "show_ui") Whether to list the taxonomy in the Tag Cloud Widget controls.'=>'(по умолчанию: наследуется от "show_ui") Перечислять ли таксономию в элементах управления виджета облака тегов.','Show in tag cloud.'=>'Показать в облаке тегов.','We recommend checking out %s, the latest iteration of "CMB2". Both are supported by WebDevStudios.'=>'Мы рекомендуем ознакомиться с %s, последней итерацией "CMB2". Обе поддерживаются WebDevStudios.','Choose dashicon'=>'Выберите дашикон','Clear labels'=>'Четкие метки','Used when indicating that there are no terms in the given taxonomy within the meta box and taxonomy list table.'=>'Используется при указании на отсутствие терминов в данной таксономии в таблице мета-поля и списка таксономии.','(default: false) Whether or not the post type can have parent-child relationships. At least one published content item is needed in order to select a parent.'=>'(по умолчанию: false) Может ли тип записи иметь отношения родитель-потомок. Для выбора родительского элемента требуется хотя бы один элемент опубликованного контента.','Custom Post Type UI has native support for WPGraphQL. Please <a href="%s">de-active</a> the "WPGraphQL for Custom Post Type UI" extension to proceed.'=>'Пользовательский интерфейс типа записи имеет встроенную поддержку WPGraphQL. Пожалуйста, <a href="%s">отключите</a> расширение "WPGraphQL для пользовательского пользовательского интерфейса типа записи", чтобы продолжить.','Plural name for reference in the GraphQL API.'=>'Имя во множественном числе для ссылки в API GraphQL.','GraphQL Plural Name'=>'Имя во множественном числе GraphQL','Singular name for reference in the GraphQL API.'=>'Единственное имя для справки в API GraphQL.','GraphQL Single Name'=>'Одно имя GraphQL','Whether or not to show data of this type in the WPGraphQL. Default: false'=>'Следует ли отображать данные этого типа в WPGraphQL. Значение по умолчанию: false','Show in GraphQL'=>'Показать в GraphQL','Toggle panel: GraphQL Settings'=>'Переключатель панели: Настройки GraphQL','WPGraphQL'=>'WPGraphQL','The graphql_single_name is empty for the "%s" Post Type or Taxonomy registered by Custom Post Type UI.'=>'Graphql_single_name пуст для типа записи "%s" или таксономии, зарегистрированной пользовательским интерфейсом пользовательского типа записи.','The graphql_plural_name is empty for the "%s" Post Type or Taxonomy registered by Custom Post Type UI.'=>'Graphql_plural_name пуста для типа записи "%s" или таксономии, зарегистрированных пользовательским интерфейсом пользовательского типа записи.','Back to %s'=>'Назад к %s','The text displayed after a term has been updated for a link back to main index.'=>'Текст, отображаемый после окончания семестра, был обновлен для ссылки на основной индекс.','Back to Items'=>'Вернуться к пунктам','(e.g. &larr; Back to actors'=>'(напр., & larr; Назад к актерам','The text displayed via clicking ‘Choose from the most used items’ in the taxonomy meta box when no items are available.'=>'Текст отображается с помощью нажатия "Выберите из наиболее часто используемых элементов" в таксономии мета поле, когда нет элементов доступны.','Set a default term for the taxonomy. Able to set a name, slug, and description. Only a name is required if setting a default, others are optional. Set values in the following order, separated by comma. Example: name, slug, description'=>'Установите TERM по умолчанию для таксономии. Возможность установить имя, пулю и описание. Только имя требуется при установлении по умолчанию, другие являются необязательными. Установите значения в следующем порядке, разделенные запятой. Пример: имя, пуля, описание','Default Term'=>'Term по умолчанию','Nonce failed verification'=>'Код не прошел проверку','Please visit the %1$sPost Type Templates in 4.7%2$s post on the Make WordPress Core blog for details about setting templates for multiple post types.'=>'Пожалуйста, посетите %1$sПостовые шаблоны в 4.7%2$s пост в блоге Make WordPress Core для получения подробной информации о настройке шаблонов для нескольких типов сообщений.','How do I add custom post type support for custom templates selection like pages have?'=>'Как добавить поддержку пользовательских типов записей для выбора пользовательских шаблонов, как у страниц?','Taxonomy options'=>'Варианты таксономии','(CPTUI default: false) Whether to delete posts of this type when deleting a user.'=>'(CPTUI по умолчанию: false) Удалять ли сообщения этого типа при удалении пользователя.','Delete with user'=>'Удалить с пользователем','%s updated.'=>'%s обновлён.','(e.g. Movie updated)'=>'(напр., Фильм обновлен)','Used in the editor notice after updating a post. Default "Post updated." / "Page updated."'=>'Используется в уведомлении редактора после обновления сообщения. По умолчанию "Сообщение обновлено" / "Страница обновлена."','Item Updated'=>'Элемент обновлеён','%s scheduled'=>'%s запланирован','(e.g. Movie scheduled)'=>'(например, запланировано кино)','Used in the editor notice after scheduling a post to be published at a later date. Default "Post scheduled." / "Page scheduled."'=>'Используется в уведомлении редактора после планирования публикации, которая будет опубликована позднее. По умолчанию "Сообщение запланировано" / "Страница запланирована".','Item Scheduled'=>'Элемент запланирован','%s reverted to draft.'=>'%s преобразован в черновик.','(e.g. Movie reverted to draft)'=>'(например, фильм возвращён в черновик)','Used in the editor notice after reverting a post to draft. Default "Post reverted to draft." / "Page reverted to draft."'=>'Используется в уведомлении редактора после возврата сообщения в черновик. По умолчанию "Сообщение возвращено к черновику" / "Страница вернулась к черновику."','Item Reverted To Draft'=>'Элемент возвращён к черновику','%s published privately.'=>'%s опубликована приватно.','(e.g. Movie published privately.)'=>'(например, фильм, опубликованный в частном порядке.)','Used in the editor notice after publishing a private post. Default "Post published privately." / "Page published privately."'=>'Используется в уведомлении редактора после публикации личного сообщения. По умолчанию "Сообщение опубликовано в частном порядке." / "Страница опубликована в частном порядке."','Item Published Privately'=>'Элемент опубликован в частном порядке','%s published'=>'%s опубликовано','(e.g. Movie published)'=>'(напр., Фильм опубликован)','Used in the editor notice after publishing a post. Default "Post published." / "Page published."'=>'Используется в уведомлении редактора после публикации сообщения. По умолчанию "Публикация опубликована" / "Страница опубликована".','Item Published'=>'Элемент опубликован','%s attributes'=>'%s атрибуты','Filter %s list'=>'Фильтровать список %s','Upload to this %s'=>'Загрузить на этот %s','Insert into %s'=>'Вставить в %s','%s archives'=>'Архивы %s','Use as featured image for this %s'=>'Использовать в качестве избранного изображения для этого %s','Remove featured image for this %s'=>'Удалить избранные изображения для этого %s','Set featured image for this %s'=>'Установить рекомендуемое изображение для этого %s','Featured image for this %s'=>'Главное изображение для этого %s','No %s found in trash'=>'%s не найдено в корзине','Add new'=>'Добавить новый','My %s'=>'Мои %s','Edit %1$s (%2$s)'=>'Редактировать %1$s (%2$s)','Content types registered with Custom Post Type UI.'=>'Типы контента, зарегистрированные в пользовательском интерфейсе типа поста.','%s list'=>'%s список','%s list navigation'=>'%s навигация по списку','No %s'=>'Нет %s','No %s found'=>'%s не найдено','Update %s name'=>'Обновить имя %s','Post type options'=>'Параметры типа сообщения','Auto-populate labels'=>'Автозаполнение ярлыков','Populate missing labels based on chosen labels'=>'Заполнение отсутствующих меток на основе выбранных меток','Populate additional labels based on chosen labels'=>'Заполнение дополнительных меток на основе выбранных меток','Please select a post type to associate with.'=>'Пожалуйста, выберите тип сообщения для связи.','Sets a callback function name for the meta box display. Hierarchical default: post_categories_meta_box, non-hierarchical default: post_tags_meta_box. To remove the metabox completely, use "false".'=>'Устанавливает имя функции обратного вызова для отображения мета-поля. Иерархическое значение по умолчанию: post_categories_meta_box, неиерархическое значение по умолчанию: post_tags_meta_box. Чтобы полностью удалить метабокс, используйте "false".','(Custom Post Type UI default: true) Whether to show this taxonomy data in the WP REST API.'=>'(Пользовательский интерфейс пользовательского типа по умолчанию: true) Отображать ли эти данные таксономии в API REST WP.','Successfully saved data to file.'=>'Успешно сохраненные данные в файл.','Error saving data.'=>'Ошибка сохранения данных.','Please provide a path to export your data to.'=>'Пожалуйста, укажите путь для экспорта ваших данных.','Please provide whether you are exporting your post types or taxonomies'=>'Укажите, экспортируете ли вы свои типы сообщений или таксономии','Imported %s successfully'=>'Импортировано %s успешно','An error on import occurred'=>'Произошла ошибка при импорте','No JSON data found'=>'Данные JSON не найдены','Please provide a path to the file holding your CPTUI JSON data.'=>'Пожалуйста, укажите путь к файлу, содержащему ваши данные CPTUI JSON.','Please provide whether you are importing post types or taxonomies'=>'Укажите, импортируете ли вы типы записей или таксономии','Review %s'=>'Обзор %s','All Custom Post Type UI Taxonomies'=>'Все пользовательские почтовый тип UI таксономии','All Custom Post Type UI Post Types'=>'Все пользовательские типы сообщений','Export Taxonomies settings'=>'Настройки экспорта таксономий','Export Post Types settings'=>'Настройки экспорта типов постов','Metabox callback'=>'Metabox обратный вызов','(default: WP_REST_Terms_Controller) Custom controller to use instead of WP_REST_Terms_Controller.'=>'(по умолчанию: WP_REST_Terms_Controller) Пользовательский контроллер для использования вместо WP_REST_Terms_Controller.','(default: value of "public" setting) Whether or not the taxonomy should be publicly queryable.'=>'(по умолчанию: значение параметра" public") независимо от того, должна ли таксономия быть общедоступной для запроса.','Public Queryable'=>'Public Queryable','(default: true) Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'(по умолчанию: true) Независимо от того, предназначена ли таксономия для публичного использования либо через интерфейс администратора, либо через интерфейсных пользователей.','Add support for available registered post types. At least one is required. Only public post types listed by default.'=>'Добавить поддержку для доступных зарегистрированных типов сообщений. По крайней мере, один требуется. Только публичные типы сообщений перечислены по умолчанию.','We recommend %s for some extended customization and addition of extra fields regarding roles and capabilities.'=>'Мы рекомендуем %s для расширенной настройки и добавления дополнительных полей, касающихся ролей и возможностей.','Any help with customizing capabilities?'=>'Любая помощь с настройкой возможностей?','(default: true) Should the permalink structure be prepended with the front base. (example: if your permalink structure is /blog/, then your links will be: false->/news/, true->/blog/news/).'=>'(по умолчанию: true) Должна ли структура постоянных ссылок быть добавлена к передней базе. (пример: если ваша структура постоянной ссылки /blog/, тогда ваши ссылки будут: false->/news/, true->/blog/news/).','The post type to use for checking read, edit, and delete capabilities. A comma-separated second value can be used for plural version.'=>'Тип записи, используемый для проверки возможностей чтения, редактирования и удаления. Второе значение, разделенное запятыми, может использоваться для множественной версии.','(default: WP_REST_Posts_Controller) Custom controller to use instead of WP_REST_Posts_Controller.'=>'(по умолчанию: WP_REST_Posts_Controller) Пользовательский контроллер для использования вместо WP_REST_Posts_Controller.','REST API controller class'=>'Класс контроллера REST API','(Custom Post Type UI default: true) Whether or not to show this post type data in the WP REST API.'=>'(Пользовательский интерфейс пользовательского типа сообщения по умолчанию: true) Отображать или нет данные этого типа сообщения в API REST WP.','Used in New in Admin menu bar. Default "singular name" label.'=>'Используется в строке меню New in Admin. По умолчанию ярлык "единственное имя".','"New" menu in admin bar'=>'"Новое" меню в админке','Slug already exists'=>'Slug уже существует','Custom Post Type UI registered taxonomies count total: %d'=>'Пользовательский тип поста Пользовательский интерфейс Всего зарегистрированных таксономий: %d','Custom Post Type UI registered post types count total: %d'=>'Пользовательский интерфейс типа записей Пользовательский интерфейс Количество зарегистрированных сообщений: %d','Custom Post Type UI debug information for %s'=>'Отладочная информация пользовательского интерфейса пользовательского типа для %s','View our Layouts page'=>'Посмотреть наши макеты страницы','Please note that %1$s this plugin will not handle display %2$s of registered post types or taxonomies in your current theme. It simply registers them for you. To display your data, check out %3$s. %4$s to see some examples that are available with Custom Post Type UI Extended. If all else fails, visit us on the %5$s'=>'Обратите внимание, что %1$s этот плагин не будет обрабатывать отображение %2$s зарегистрированных типов сообщений или таксономий в вашей текущей теме. Он просто регистрирует их для вас. Чтобы отобразить данные, ознакомьтесь с %3$s. %4$s увидеть некоторые примеры, доступные с пользовательским пользовательским интерфейсом Custom Post Type Extended. Если все остальное не помогает, посетите нас на %5$s','All of the selectable code snippets below are useful if you wish to migrate away from Custom Post Type UI and retain your existing registered post types or taxonomies.'=>'Все приведенные ниже фрагменты кода, которые можно выбрать, полезны, если вы хотите перейти от пользовательского интерфейса пользовательских типов записей и сохранить существующие зарегистрированные типы записей или таксономии.','Invalid data provided'=>'Предоставлены неверные данные','Successfully imported data.'=>'Успешно импортированные данные.','Add support for various available post editor features on the right. A checked value means the post type feature is supported.'=>'Добавьте поддержку различных доступных функций редактора постов справа. Проверенное значение означает, что функция типа сообщения поддерживается.','(e.g. Movies Attributes)'=>'(например, атрибуты фильмов)','Used for the title of the post attributes meta box.'=>'Используется для заголовка мета-поля атрибутов поста.','Attributes'=>'Атрибуты','(e.g. View Movies)'=>'(напр., Просмотр фильмов)','View Items'=>'Просмотр элементов','No associated taxonomies'=>'Не связанные таксономии','Tools'=>'Инструменты','Custom Post Type UI Tools'=>'Custom Post Type UI инструменты ','Object'=>'Объект','Remove these ads?'=>'Удалить эту рекламу?','(default: false) Whether to show the taxonomy in the quick/bulk edit panel.'=>'(по умолчанию: false) Отображать ли таксономию на панели быстрого / массового редактирования.','(default: false) Should the permastruct allow hierarchical urls.'=>'(по умолчанию: false). Если permastruct разрешает иерархические URL.','(default: true) Whether or not WordPress should use rewrites for this taxonomy.'=>'(по умолчанию: true) следует ли WordPress использовать перезаписи для этой таксономии.','(default: true) Sets the query_var key for this taxonomy.'=>'(по умолчанию: true) задает ключ query_var для этой таксономии.','(default: value of public) Whether to make the taxonomy available for selection in navigation menus.'=>'(по умолчанию: значение public) следует ли сделать таксономию доступной для выбора в навигационных меню.','Show in nav menus'=>'Показывать в меню навигации','(default: value of show_ui) Whether to show the taxonomy in the admin menu.'=>'(по умолчанию: значение show_ui) показывать ли таксономию в меню администратора.','Show in menu'=>'Показать в меню','(default: true) Whether to generate a default UI for managing this custom taxonomy.'=>'(по умолчанию: true) следует ли создавать пользовательский интерфейс по умолчанию для управления этой пользовательской таксономией.','Import/Export Taxonomies'=>'Импорт/экспорт таксономии','Add support for available registered taxonomies.'=>'Добавить поддержку зарегистрированных таксономий.','Use this input to register custom "supports" values, separated by commas. Learn about this at %s'=>'Используйте этот ввод для регистрации пользовательских значений "поддержки", разделенных запятыми. Узнайте об этом на %s','The top-level admin menu page file name for which the post type should be in the sub menu of.'=>'Имя файла страницы меню администратора верхнего уровня, для которого тип сообщения должен быть в подменю.','(default: true) Whether or not to show the post type in the admin menu and where to show that menu.'=>'(по умолчанию: true) Показывать или нет тип сообщения в меню администратора и где показывать это меню.','Available options'=>'Доступные параметры','See %s in the "menu_position" section. Range of 5-100'=>'Смотрите %s в разделе "menu_position". Диапазон 5-100','(default: true) Sets the query_var key for this post type.'=>'(по умолчанию: true) Задает ключ, query_var за этот пост типа.','(default: true) Should the permastruct be prepended with the front base.'=>'(по умолчанию: true) Permastruct должен добавляться с переднюю подставку.','(default: true) Whether or not WordPress should use rewrites for this post type.'=>'(по умолчанию: true) Должен ли WordPress использовать переписывания для этого типа записей.','(default: false) Whether or not the post type will have a post type archive URL.'=>'(по умолчанию: false) Будет ли тип записи иметь URL архива типа записи.','(Custom Post Type UI default: true) Whether or not this post type is available for selection in navigation menus.'=>'(Пользовательский интерфейс пользовательского типа сообщения по умолчанию: true) Доступен ли этот тип сообщения для выбора в навигационных меню.','(default: true) Whether or not to generate a default UI for managing this post type.'=>'(по умолчанию: true) Ли для создания пользовательского интерфейса по умолчанию для управления этот пост типа.','(default: true) Whether or not queries can be performed on the front end as part of parse_request()'=>'(по умолчанию: true) Могут ли запросы выполняться во внешнем интерфейсе как часть parse_request ()','Publicly Queryable'=>'Публично запрашиваемыми','(Custom Post Type UI default: true) Whether or not posts of this type should be shown in the admin UI and is publicly queryable.'=>'(Пользовательский интерфейс пользовательских типов сообщений по умолчанию: true) Должны ли публикации этого типа отображаться в пользовательском интерфейсе администратора и доступны ли они для общего доступа.','Toggle panel: Settings'=>'Панель переключения: Параметры','Used for hierarchical types that need a colon.'=>'Используется для иерархических типов, которым требуется двоеточие.','Toggle panel: Additional labels'=>'Панель переключения: дополнительные ярлыки','Slug has changed'=>'Slug изменился','Toggle panel: Basic settings'=>'Панель переключения: основные настройки','Import/Export Post Types'=>'Импорт/Экспорт типов записи','*Replace "post_slug" with the slug of the actual post.'=>'* Заменить "post_slug" на слаг фактической должности.','Get code'=>'Получить код','More from %s'=>'Ещё из %s','Thank you for choosing Custom Post Type UI! We hope that your experience with our plugin makes creating post types and taxonomies and organizing your content quick and easy.'=>'Благодарим вас за выбор пользовательского интерфейса для типа пост! Мы надеемся, что ваш опыт с нашими плагин делает создание поста типы и таксономии и организовать ваше содержание быстро и легко.','Subscribe'=>'Подписаться','Email address'=>'Адрес электронной почты','Get email updates from pluginize.com about Custom Post Type UI'=>'Получить обновления по электронной почте от pluginize.com о пользовательского интерфейса типа в должности','We encourage checking out %1$s for easily displaying post type content wherever you can utilize a shortcode. If you prefer to handle on your own, you will need to utilize the %2$s class to handle display in custom locations. If you have set the post type to have archives, the archive url should be something like "http://www.mysite.com/post-type-slug"'=>'Мы рекомендуем проверить %1$s для легкого отображения контента типа поста везде, где вы можете использовать шорткод. Если вы предпочитаете обрабатывать самостоятельно, вам нужно будет использовать класс %2$s для обработки отображения в пользовательских расположениях. Если вы установили тип записи для архивов, URL-адрес архива должен быть чем-то вроде «http://www.mysite.com/post-type-slug»','No it does not. The Shortcode builder is not multisite dependent and will work with either setup.'=>'Нет это не так. Короткий номер строитель зависит не семейств и будет работать с любой установки.','Does Custom Post Type UI Extended require multisite?'=>'Пользовательские пост типа пользовательского интерфейса расширенной требует многосайтовой?','Yes you will. The Custom Post Type UI Extended is not a replacement of the free version with added extra features. It acts based on the data made available through Custom Post Type UI'=>'Да, вы будете. Пользовательский интерфейс расширенного пользовательского типа не заменяет бесплатную версию дополнительными функциями. Он действует на основе данных, предоставляемых через пользовательский интерфейс типа поста','Do I still need Custom Post Type UI if I purchase and install Custom Post Type UI Extended?'=>'Нужен ли пользовательский интерфейс пользовательского типа, если я приобрету и установлю пользовательский пользовательский интерфейс расширенного типа?','No, there is no data being sent out from your site with these. The only way anything is tracked is via UTM parameters for WebDevStudios\'s analytics so we can get an idea of where traffic is coming from. Those are only tracked if you actually click on an ad spot.'=>'Нет, с этих сайтов не отправляются данные. Единственный способ отслеживать - это параметры UTM для аналитики WebDevStudios, чтобы мы могли понять, откуда идет трафик. Они отслеживаются только в том случае, если вы нажимаете на рекламное место.','Are these ad spots tracking my personal information in any way?'=>'Эти объявления пятна отслеживаются мои персональные данные каким-либо образом?','You can have them automatically removed from display via a purchased copy of %s.'=>'Вы можете автоматически удалить их с экрана через купленную копию %s.','How can I remove the ads that suddenly started showing up?'=>'Как удалить рекламу, которая неожиданно начала появляться?','No. These spots are intended for and will only be used for other available WebDevStudios products and services.'=>'Нет. Эти места предназначены и будут использоваться только для других доступных продуктов и услуг WebDevStudios.','Will these ad spots ever show third-party data?'=>'Эти объявления пятна всегда покажет данные третьих лиц?','Pluginize offers both free and paid WordPress plugins.'=>'Pluginize предлагает как бесплатные, так и платные плагины для WordPress.','What does Pluginize offer?'=>'Что предлагает Pluginize?','Pluginize is a marketplace of plugins by WebDevStudios.'=>'Pluginize представляет собой рынок модулей WebDevStudios.','What is Pluginize?'=>'Что такое Pluginize?','Pluginize'=>'Pluginize','CPTUI Extended'=>'Расширенный CPTUI','Support forums'=>'Форум поддержки','About'=>'О нас','Please provide a post type to attach to.'=>'Пожалуйста, укажите тип сообщения для прикрепления.','Show in quick/bulk edit panel.'=>'Показать в панели быстрого / массового редактирования.','Screen reader text for the items list heading on the term listing screen.'=>'Текст программы чтения с экрана для заголовка списка элементов на экране списка терминов.','(e.g. Actors list)'=>'(напр., список актёров)','Screen reader text for the pagination heading on the term listing screen.'=>'Текст программы чтения с экрана для заголовка нумерации страниц на экране списка терминов.','(e.g. Actors list navigation)'=>'(напр., навигация по списку актеров)','Used when indicating that there are no terms in the given taxonomy associated with an object.'=>'Используется, когда указывается, что в данной таксономии нет терминов, связанных с объектом.','No terms'=>'Без условий','(e.g. No actors)'=>'(напр., Нет актёров)','Used at the top of the term editor screen and button text for a new taxonomy term.'=>'Используется в верхней части экрана редактора терминов и текста кнопки для нового термина таксономии.','Used in the admin bar when viewing editor screen for an existing taxonomy term.'=>'Используется в панели администратора при просмотре экрана редактора для существующего термина таксономии.','Used at the top of the term editor screen for an existing taxonomy term.'=>'Используется в верхней части экрана редактора терминов для существующего термина таксономии.','Used as tab text when showing all terms for hierarchical taxonomy while editing post.'=>'Используется в качестве текста вкладки при отображении всех терминов для иерархической таксономии при редактировании публикации.','Custom admin menu name for your taxonomy.'=>'Название пользовательского меню администратора для вашей таксономии.','Describe what your taxonomy is used for.'=>'Опишите, для чего используется ваша таксономия.','Used for the taxonomy admin menu item.'=>'Используется для пункта меню администратора таксономии.','Migrate terms to newly renamed taxonomy?'=>'Перенос условий на недавно переименованную таксономию?','DO NOT EDIT the taxonomy slug unless also planning to migrate terms. Changing the slug registers a new taxonomy entry.'=>'НЕ РЕДАКТИРУЙТЕ блок таксономии, если только вы не планируете переносить термины. Изменение слага регистрирует новую запись таксономии.','The taxonomy name/slug. Used for various queries for taxonomy content.'=>'Название таксономии / slug. Используется для различных запросов контента таксономии.','View Taxonomies'=>'Посмотреть таксономии','Please choose a different post type name. %s matches an existing page slug, which can cause conflicts.'=>'Пожалуйста, выберите другое имя типа сообщения. %s соответствует существующему фрагменту страницы, что может вызвать конфликты.','(WP Core)'=>'(Ядро WP)','Choose image icon'=>'Выберите значок изображения','Image URL or %sDashicon class name%s to use for icon. Custom image should be 20px by 20px.'=>'URL изображения или %sимя класса Dashicon%s, используемое для значка. Пользовательское изображение должно быть 20 на 20 пикселей.','(e.g. Movies list)'=>'(напр., Список фильмов)','Screen reader text for the items list heading on the post type listing screen.'=>'Текст программы чтения с экрана для заголовка списка элементов на экране списка типов записей.','Items List'=>'Список элементов','(e.g. Movies list navigation)'=>'(например, навигация по списку фильмов)','Screen reader text for the pagination heading on the post type listing screen.'=>'Текст программы чтения с экрана для заголовка нумерации страниц на экране списка типов записей.','Items List Navigation'=>'Навигация по списку элементов','(e.g. Filter movies list)'=>'(например, фильтровать список фильмов)','Screen reader text for the filter links heading on the post type listing screen.'=>'Текст программы чтения с экрана для заголовков ссылок фильтра на экране списка типов сообщений.','Filter Items List'=>'Фильтр списка  пунктов','(e.g. Uploaded to this movie)'=>'(например, загруженный в этот фильм)','Used as the "Uploaded to this post" or "Uploaded to this page" phrase for the post type.'=>'Используется в качестве «Загруженный на этот пост» или «Загруженный на эту страницу» фраза типа пост.','Uploaded to this Item'=>'Загрузить в этот элемент','(e.g. Insert into movie)'=>'(например, вставить в фильм)','Used as the "Insert into post" or "Insert into page" phrase for the post type.'=>'Используется как фраза «Вставить в сообщение» или «Вставить в страницу» для типа сообщения.','Insert into item'=>'Вставить в элемент','(e.g. Movie archives)'=>'(например, архивы кино)','Post type archive label used in nav menus.'=>'Метка архива типа сообщения, используемая в навигационных меню.','(e.g. Use as featured image for this movie)'=>'(например, использовать в качестве рекомендуемого изображения для этого фильма)','Used as the "Use as featured image" phrase for the post type.'=>'Используется как фраза "Использовать как изображение" для типа записи.','Use Featured Image'=>'Использовать рекомендуемое изображение','(e.g. Remove featured image for this movie)'=>'(напр., Удалить изображение записи для этого фильма)','Used as the "Remove featured image" phrase for the post type.'=>'Используется как фраза «Удалить избранные изображения» для пост типа.','Remove Featured Image'=>'Удалить рекомендуемое изображение','(e.g. Set featured image for this movie)'=>'(например, Установить рекомендуемое изображение для этого фильма)','Used as the "Set featured image" phrase for the post type.'=>'Используется как фраза "Установить рекомендуемое изображение" для типа записи.','Set Featured Image'=>'Установить рекомендуемое изображение','(e.g. Featured image for this movie)'=>'(напр., Изображение записи для этого фильма)','Used as the "Featured Image" phrase for the post type.'=>'Используется как фраза «Избранные изображения» для пост типа.','Used when there are no posts to display on the post type list trash screen.'=>'Используется, когда нет сообщений для отображения на мусорном экране списка типов сообщений.','Used when there are no posts to display on the post type list screen.'=>'Используется, когда нет сообщений для отображения на экране списка типов сообщений.','Used as the text for the search button on post type list screen.'=>'Используется в качестве текста для кнопки поиска на экране списка типов сообщений.','Used in the admin bar when viewing editor screen for a published post in the post type.'=>'Используется в панели администратора при просмотре экрана редактора для опубликованного сообщения в типе сообщения.','Used at the top of the post editor screen for an existing post type post.'=>'Используется в верхней части экрана редактора сообщений для существующего сообщения.','Used at the top of the post editor screen for a new post type post.'=>'Используется в верхней части экрана редактора сообщений для записи нового типа.','Used in the post type admin submenu.'=>'Используется в подменю admin типа пост.','Perhaps describe what your custom post type is used for?'=>'Возможно, опишите, для чего используется ваш пользовательский тип записи?','Post Type Description'=>'Тип описание','Additional labels'=>'Дополнительные ярлыки','Used when a singular label is needed.'=>'Используется, когда требуется особая метка.','Used for the post type admin menu item.'=>'Используется для пункта меню типа администратора.','DO NOT EDIT the post type slug unless also planning to migrate posts. Changing the slug registers a new post type entry.'=>'НЕ РЕДАКТИРУЙТЕ слаг типа поста, если также не планируете переносить посты. Изменение слага регистрирует новую запись типа записи.','The post type name/slug. Used for various queries for post type content.'=>'Тип сообщения название / слаг. Используется для различных запросов к типу контента.','Basic settings'=>'Базовые настройки','View Post Types'=>'Посмотреть типы сообщений','Are you sure you want to delete this? Deleting will NOT remove created content.'=>'Вы уверены, что хотите удалить это? Удаление НЕ удалит созданный контент.','(default: taxonomy slug). Query var needs to be true to use.'=>'(по умолчанию: Taxonomy slug). Запрос var должен быть истинным для использования.','Visit the Import/Export page and copy the export code into the import side on the left. Replace the space with an underscore and then click "Import". You should be able to delete the individual post types afterwards.'=>'Посетите страницу импорта/экспорта и скопируйте код экспорт в стороне импорта на левой стороне. Заменить пространство с символом подчеркивания и нажмите кнопку «Импорт». Вы должны быть в состоянии удалить типы индивидуальный пост потом.','I have post types with spaces in their slug and can not successfully delete them. How can I fix that?'=>'У меня есть типы записей с пробелами в их слаге, и я не могу их успешно удалить. Как я могу это исправить?','Custom query var slug to use instead of the default.'=>'Пользовательский запрос var slug для использования вместо значения по умолчанию.','(default: post type slug) Query var needs to be true to use.'=>'(по умолчанию: пост типа slug) Запроса var должно быть true для использования.','Custom Query Var Slug'=>'Пользовательский запрос Var Slug','Slug to use in REST API URLs.'=>'Slug для использования в URL-адресах API REST.','REST API base slug'=>'Базовый  slug REST API','Show in REST API'=>'Включить в REST','Show in Nav Menus'=>'Показывать в меню навигации','No taxonomies registered for display. Visit %s to get started.'=>'Нет таксономий, зарегистрированных для отображения. Посетите %s, чтобы начать.','*Replace "term_slug" with the slug of the actual taxonomy term.'=>'* Замените "term_slug" на slug фактического таксономического термина.','Archives'=>'Архивы','No post types registered for display. Visit %s to get started.'=>'Не пост типы зарегистрированы для отображения. Посетите %s для начала.','Template hierarchy Theme Handbook'=>'Шаблон иерархии Тематический справочник','Single Posts file name examples.'=>'Примеры имен файлов с одиночными сообщениями.','Archives file name examples.'=>'Примеры имен файлов архивов.','Template Hierarchy'=>'Иерархия шаблонов','Send debug info'=>'Отправить отладочную информацию','Please provide an email address to send debug information to: '=>'Пожалуйста, укажите адрес электронной почты для отправки отладочной информации: ','%s Taxonomy'=>'Таксономия %s','%s Post Type'=>'Тип записи %s','This will not export the associated posts or taxonomy terms, just the settings.'=>'Это не будет экспортировать связанные посты или условия таксономии, только настройки.','Debug Info'=>'Информация по отладке','What\'s new in version %s'=>'Что нового в версии %s','If you have sought support for Custom Post Type UI on the forums, you may be requested to send the information below to the plugin developer. Simply insert the email they provided in the input field at the bottom and click the "Send debug info" button. Only the data below will be sent to them.'=>'Если вы искали поддержку пользовательского интерфейса пользовательского типа сообщений на форумах, вам может быть предложено отправить информацию ниже разработчику плагина. Просто вставьте адрес электронной почты, который они предоставили в поле ввода внизу, и нажмите кнопку «Отправить отладочную информацию». Им будут отправлены только данные ниже.','https://webdevstudios.com/'=>'https://webdevstudios.com/','WebDevStudios'=>'WebDevStudios','Admin UI panel for registering custom post types and taxonomies'=>'Панель пользовательского интерфейса администратора для регистрации пользовательских типов записи и таксономий.','https://github.com/WebDevStudios/custom-post-type-ui/'=>'https://github.com/WebDevStudios/custom-post-type-ui/','Please choose a different taxonomy name. %s is already registered.'=>'Выберите другое название таксономии. %s уже зарегистрирован.','Please provide a taxonomy name'=>'Пожалуйста, укажите название таксономии','Please provide a taxonomy to delete'=>'Пожалуйста, укажите таксономию для удаления','(default: false) Whether to allow automatic creation of taxonomy columns on associated post-types.'=>'(по умолчанию: false) Разрешить ли автоматическое создание столбцов таксономии для связанных типов постов.','Show Admin Column'=>'Показать Колонку администратора','Rewrite Hierarchical'=>'Переписать иерархический','Rewrite With Front'=>'Переписать с фронта','Custom taxonomy rewrite slug.'=>'Пользовательская таксономия переписывает slug.','(default: taxonomy name)'=>'(по умолчанию: Название таксономии)','Sets a custom query_var slug for this taxonomy.'=>'Задает пользовательский slug query_var для этой таксономии.','Custom Query Var String'=>'Строка настраиваемого запроса Var','Not found'=>'Не найдено','(e.g. No Actors found)'=>'(напр., Актеры не найдены)','Choose From Most Used'=>'Выберите из наиболее используемых','(e.g. Choose from the most used Actors)'=>'(напр., Выбрать из наиболее часто используемых актеров)','Add or Remove Items'=>'Добавить или удалить элементы','(e.g. Add or remove Actors)'=>'(напр., Добавить или удалить актеров)','Separate Items with Commas'=>'Отдельные элементы с запятыми','(e.g. Separate Actors with commas)'=>'(напр., Разделяйте актеров запятыми)','Popular Items'=>'Популярные элементы','(e.g. Popular Actors)'=>'(напр., Популярные актеры)','Search Items'=>'Найти элементы','(e.g. Search Actors)'=>'(напр., Поиск актеров)','Parent Item Colon'=>'Parent Item Colon','(e.g. Parent Actor:)'=>'(например, Родительский актер:)','Parent Item'=>'Родительская запись','(e.g. Parent Actor)'=>'(напр., Родительский актер)','New Item Name'=>'Имя нового элемента','(e.g. New Actor Name)'=>'(напр., Имя нового актера)','(e.g. Add New Actor)'=>'(напр., добавить нового актёра)','Update Item Name'=>'Обновить имя элемента','(e.g. Update Actor Name)'=>'(напр., Обновить имя актера)','(e.g. View Actor)'=>'(напр., Посмотреть актера)','(e.g. Edit Actor)'=>'(напр., Изменить актёра)','(e.g. All Actors)'=>'(напр., Все актеры)','Custom taxonomy label. Used in the admin menu for displaying taxonomies.'=>'Пользовательский таксономический ярлык. Используется в меню администратора для отображения таксономий.','Add Taxonomy'=>'Добавить таксономию','Delete Taxonomy'=>'Удалить таксономию','Save Taxonomy'=>'Сохранить таксономию','Attach to Post Type'=>'Прикрепить к типу записи','(e.g. Actor)'=>'(напр., Актер)','(e.g. Actors)'=>'(напр., актёры)','Taxonomy Slug'=>'Ярлык таксономии','Change text inside the post/page editor title field. Should be able to adapt as necessary.'=>'Изменить текст внутри поля заголовка редактора поста / страницы. Должен быть в состоянии адаптироваться по мере необходимости.','How do I filter the "enter title here" text in the post editor screen?'=>'Как отфильтровать текст "введите название здесь" на экране редактора сообщений?','%1$s has an excellent %2$spost%3$s introducing users to the %4$sPosts 2 Posts%5$s plugin that should be a good start.'=>'%1$s имеет отличную %2$sпост%3$s знакомя пользователей с плагином %4$sPosts 2 Posts%5$s который должен быть хорошим началом.','Post relationships?'=>'Пост-отношения?','Check out the %s function for documentation and usage examples.'=>'Проверьте функцию %s для документации и примеров использования.','How do I add a newly registered taxonomy to a post type that already exists?'=>'Как добавить недавно зарегистрированную таксономию в уже существующий тип записи?','How do I add custom metaboxes to my post type?'=>'Как добавить пользовательские метабоксы в мой тип записи?','Advanced'=>'Расширенные настройки','I have added categories and tags to my custom post type, but they do not appear in the archives.'=>'Я добавил категории и теги в свой тип записей, но они не отображаются в архивах.','How do I display my custom post type on my site?'=>'Как отобразить мой собственный тип записи на моем сайте?','Please visit the %1$sTemplate Hierarchy%2$s page on the WordPress codex for details about available templates.'=>'Пожалуйста, посетите страницу %1$sTemplate Hierarchy%2$s в кодексе WordPress для получения подробной информации о доступных шаблонах.','What template files should I edit to alter my post type display?'=>'Какие файлы шаблонов я должен отредактировать, чтобы изменить отображение моего типа поста?','Front-end Display'=>'Внешний дисплей','Make sure your theme has post "post-thumbnails" theme support enabled.'=>'Убедитесь, что в вашей теме включена поддержка тем "post-thumbnails".','I have added post thumbnail and/or post format support to my post type, but those do not appear when adding a post type post.'=>'Я добавил миниатюру постов и / или поддержку формата поста в свой тип поста, но они не отображаются при добавлении поста типа поста.','Renaming the slug for a post type or taxonomy creates a new entry in our saved option which gets registered as its own post type or taxonomy. Since the settings will be mirrored from the previous slug, you will just need to delete the previous version\'s entry.'=>'Переименование пули для типа записи или таксономии создает новую запись в нашей сохраненной опции, которая регистрируется как его собственный тип записи или таксономия. Поскольку настройки будут зеркально отражены от предыдущего слага, вам просто нужно удалить запись предыдущей версии.','I changed my custom post type or taxonomy slug and now I have duplicates shown. How do I remove the duplicate?'=>'Я изменил свой пользовательский тип записи или слаг таксономии, и теперь у меня отображаются дубликаты. Как мне удалить дубликаты?','You can either change the custom post type name back to the original name or try the Post Type Switcher plugin'=>'Вы можете либо изменить собственное имя типа записи обратно на исходное имя, либо попробовать плагин Post Type Switcher','I changed my custom post type name and now I can not get to my posts. How do I get them back?'=>'Я изменил свое собственное имя типа сообщения и теперь не могу попасть на него. Как мне их вернуть?','General'=>'Общее','Support Forums'=>'Форумы поддержки','Custom Post Type UI Support'=>'Поддержка пользовательского интерфейса типа поста','Please choose a different post type name. %s is already registered.'=>'Пожалуйста, выберите другое имя типа сообщения. %s уже зарегистрирован.','Please do not use quotes in post type/taxonomy names or rewrite slugs'=>'Пожалуйста, не используйте кавычки в названиях типов постов / таксономий или переписывайте слагов','Please provide a post type name'=>'Пожалуйста, укажите название типа сообщения','Please provide a post type to delete'=>'Пожалуйста, укажите тип сообщения для удаления','Adds %s support'=>'Добавляет поддержку %s','Provide custom support slugs here.'=>'Обеспечивает поддержку пользовательских slugs здесь.','Custom "Supports"'=>'Пользовательские " Поддержки"','None'=>'Отсутствует','Use the "None" option to explicitly set "supports" to false.'=>'Используйте параметр «None» явно задать «поддерживает» значение false.','Post Formats'=>'Форматы записи','Page Attributes'=>'Атрибуты страницы','Author'=>'Автор','Featured Image'=>'Популярные изображения','Revisions'=>'Редакции','Comments'=>'Комментарии','Custom Fields'=>'Кастомные поля','Trackbacks'=>'Обратные ссылки','Excerpt'=>'Отрывок','Editor'=>'Редактор','Title'=>'Заголовок','(Full URL for icon or Dashicon class)'=>'(Полный URL для иконки или класса Dashicon)','Menu Icon'=>'Иконка меню','"Show UI" must be "true". If an existing top level page such as "tools.php" is indicated for second input, post type will be sub menu of that.'=>'"Show UI" должно быть «true». Если для второго ввода указана существующая страница верхнего уровня, такая как "tools.php", то тип публикации будет подменю этого.','Show in Menu'=>'Показывать в меню','The position in the menu order the post type should appear. show_in_menu must be true.'=>'Положение в порядке меню должно отображать тип сообщения. show_in_menu должно быть true.','Menu Position'=>'Положение в меню','Query Var'=>'Запрос Var','With Front'=>'Лицевая (Главная) страница','Custom post type slug to use instead of the default.'=>'Настраиваемый тип записи для использования вместо значения по умолчанию.','(default: post type slug)'=>'(по умолчанию: ярлык типа записей)','Custom Rewrite Slug'=>'Пользовательская перезапись Slug','Rewrite'=>'Перезапись','Hierarchical'=>'Иерархическая структура','Capability Type'=>'Тип возможности','Exclude From Search'=>'Исключить из поиска','Slug to be used for archive URL.'=>'Slug, который будет исп