omy'=>'Таксономия','No custom labels to display'=>'Без пользовательских меток для отображения','View frontend archive'=>'Просмотреть внешний интерфейс','Labels'=>'Этикетки','Supports'=>'Поддержка','Post Type'=>'Тип записи','No post types to display at this time'=>'В настоящее время нет типов сообщений для отображения','No taxonomies to display at this time'=>'В настоящее время нет таксономий для отображения','Copy/paste the code below into your functions.php file.'=>'Скопируйте / вставьте приведенный ниже код в ваш файл functions.php.','Get Post Type and Taxonomy Code'=>'Получить тип сообщения и код таксономии','Use the content above to import current taxonomies into a different WordPress site. You can also use this to simply back up your taxonomy settings.'=>'Используйте содержимое выше, чтобы импортировать текущие таксономии в другой сайт WordPress. Вы также можете использовать это для простого резервного копирования настроек таксономии.','No taxonomies registered yet.'=>'Таксономии еще не зарегистрированы.','To import taxonomies from a different WordPress site, paste the exported content from that site and click the "Import" button.'=>'Чтобы импортировать таксономии с другого сайта WordPress, вставьте экспортированный контент с этого сайта и нажмите кнопку "Импорт".','Import Taxonomies'=>'Импорт таксономии','Use the content above to import current post types into a different WordPress site. You can also use this to simply back up your post type settings.'=>'Используйте содержимое выше, чтобы импортировать текущие типы записей на другой сайт WordPress. Вы также можете использовать это, чтобы просто создать резервную копию настроек типа вашего сообщения.','To copy the system info, click below then press Ctrl + C (PC) or Cmd + C (Mac).'=>'Чтобы скопировать информацию о системе, щёлкните мышью внизу, а затем нажмите Ctrl + C (для PC) или Cmd + C (для Mac).','No post types registered yet.'=>'Типы не поста зарегистрированы.','Import'=>'Импорт','To import post types fro